function btn11(){
    //records for module_properties:
    var config = {
        schemaName: 'ehr',
        queryName: 'module_properties',
        rows: [],
        success: onSuccess,
        error: onError
    };
    var fields = ('prop_name,stringvalue,floatvalue').split(',');
    var data = [
        ['site_email', 'EHR-do-not-reply@primate.wisc.edu', '']
    ];

    LABKEY.Query.insertRows(makeObject(config, data, fields));
}

function makeObject(config, data, fields){
    Ext.each(data, function(row){
        var record = {};
        Ext.each(fields, function(f, idx){
            record[f] = row[idx];
        }, this);
        config.rows.push(record);
    }, this);
    return config;
}

function onSuccess(result){
    console.log('Success');
}

function onError(result){
    console.log('Error Loading Data');
}
